// src/components/About.js
import React from 'react';
import styled from 'styled-components';

const About = () => {
  return (
    <AboutContainer>
      <h2>About Me</h2>
      <p>Welcome to my portfolio website! I am a passionate developer with expertise in React and React Native.</p>
    </AboutContainer>
  );
};

const AboutContainer = styled.div`
  padding: 20px;
  text-align: center;
  color: #61dafb;
`;

export default About;
